import React from 'react'
import { Field, reduxForm } from 'redux-form'


const HeaderForm = () =>{
    return(
        <form>
            <Field name={''} component={'input'} />
        </form>
    )
}

const HeaderFormRedux = reduxForm({form: 'header'})(HeaderForm)

export default HeaderFormRedux
